import React from 'react';
import './App.css';
import NavBar from './NavBar';
import Middle from './Middle';

function App() {
  return (
    <div className="App">

     <NavBar/>
     <Middle/>
     <Right/>

      <footer className="App-footer">
        <a
          className="App-link"
          href="https://wearecodenation.com/courses/coding/master/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Code Nation
        </a>
      </footer>

    </div>
  );
}

export default App;
